examples:
  searchBuy:
    speakeasy-default-search-buy:
      parameters:
        query:
          location: "<value>"
          resultsPerPage: 20
          page: 1
          sortBy: "relevance"
          expandSearchArea: 0
          bedrooms: 0
          bathrooms: 1
          hidePendingContingent: false
          newConstructionOnly: false
          hideHomesNotYetBuilt: false
          foreclosuresOnly: false
          hideForeclosures: false
          seniorCommunityOnly: false
          openHousesOnly: false
          priceRecentlyReducedOnly: false
          virtualToursOnly: false
          threeDtoursOnly: false
          showHomesWhereHoaIsNotKnown: false
      responses:
        "200":
          application/json: {}
  autoComplete:
    speakeasy-default-auto-complete:
      parameters:
        query:
          input: "<value>"
          limit: 10
      responses:
        "200":
          application/json: {}
  searchRent:
    speakeasy-default-search-rent:
      parameters:
        query:
          location: "<value>"
          resultsPerPage: 20
          page: 1
          sortBy: "relevance"
          expandSearchArea: 0
          bedrooms: 0
          bathrooms: 1
          threeDtoursOnly: false
      responses:
        "200":
          application/json: {}
  searchSold:
    speakeasy-default-search-sold:
      parameters:
        query:
          location: "<value>"
          resultsPerPage: 20
          page: 1
          sortBy: "lowest_price"
          expandSearchArea: 0
          bedrooms: 0
          bathrooms: 1
      responses:
        "200":
          application/json: {}
  getPropertyDetails:
    speakeasy-default-get-property-details:
      parameters:
        query:
          propertyId: "<id>"
      responses:
        "200":
          application/json: {}
